import './App.css';

const iconList = [
    { id: 1, icon: "home icon" },
    { id: 2, icon: "info circle icon" },
];
function ReturnIcons() {
    return (
        <div className="navbar-icons">
            {iconList.map((iconObj) => (
                <div className="navbar-icon" key={iconObj.id}>
                    <i className={iconObj.icon}></i>
                </div>
            ))}
        </div>
    );
}
function App() {
    return (
        <div className="content">
            <div className="navbar">
                <ReturnIcons />
            </div>
            <div className="content-profile">
                <div className="profile-photo">
                    <img src="image-face.png" alt="" />
                </div>
            </div>
            <div className="content-hire"></div>
            <div className="content-exp"></div>
        </div>
    );
}

export default App;
